import { Component, Inject, OnDestroy, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { PouchDbService } from '../services/pouch-db.service';
import { MatDialog, MAT_DIALOG_DATA } from '@angular/material/dialog';

@Component({
	selector: 'dialog-data-example-dialog',
	template: `<h1 mat-dialog-title>{{ data.title }}</h1>`,
})
export class DialogDataExampleDialog {
	constructor(@Inject(MAT_DIALOG_DATA) public data: { title: string }) {}
}

@Component({
	selector: 'app-home-page',
	templateUrl: './home-page.component.html',
	styleUrls: ['./home-page.component.scss'],
})
export class HomePageComponent implements OnInit, OnDestroy {
	currentCard = '';
	currentPupil: [string, any][] = [];
	// iconPath = path.join(__dirname, 'workspaces/angular-app/src/assets/logo.jpg');

	constructor(
		private pouchDbService: PouchDbService,
		private router: Router,
		public dialog: MatDialog
	) {}

	ngOnInit(): void {
		this.keyDownStartListener();
	}

	keyDownStartListener = () => {
		document.addEventListener('keydown', this.captureTags);
	};

	captureTags = async (input: KeyboardEvent) => {
		console.log(input);
		if (
			!isNaN(+input.key) &&
			input.location === 0 &&
			this.currentCard.length !== 10
		) {
			this.currentCard += input.key;
		} else if (
			this.currentCard.length === 10 &&
			input.key === 'Enter' &&
			this.currentCard.startsWith('000')
		) {
			input.stopPropagation();
			try {
				const pupil = await this.pouchDbService.getTag(this.currentCard);
				if (pupil.manager === 'true') {
					this.router.navigate(['/management']);

					const dialogRef = this.dialog.open(DialogDataExampleDialog, {
						data: {
							title: 'שלום הרב מרק',
						},
					});

					dialogRef.afterOpened().subscribe(async () => {
						await new Promise((resolve) => setTimeout(resolve, 1000));
						dialogRef.close();
					});
				}
				this.currentPupil = Object.entries(pupil);
				this.currentCard = '';
			} catch (error) {
				const dialogRef = this.dialog.open(DialogDataExampleDialog, {
					data: {
						title: 'תג לא מזוהה',
					},
				});

				dialogRef.afterOpened().subscribe(async () => {
					await new Promise((resolve) => setTimeout(resolve, 1000));
					dialogRef.close();
				});

				this.currentCard = '';
				console.log(this.currentCard);
			}
		} else if (
			this.currentCard.length === 10 &&
			this.currentCard === '1111111111'
		) {
			this.currentCard = '';
			this.router.navigate(['/management']);
		} else if (
			this.currentCard.length >= 10 &&
			input.key === 'Enter' &&
			!this.currentCard.startsWith('000')
		) {
			this.currentCard = '';
		}
		console.log(
			this.currentCard.length === 10,
			this.currentCard === '1111111111'
		);

		console.log(this.currentCard);
	};

	keyDownStopListener = () => {
		document.removeEventListener('keydown', this.captureTags);
	};

	ngOnDestroy() {
		document.removeEventListener('keydown', this.captureTags);
	}

	logo =
		'data:image/jpeg;base64,';
}
